import React, { useState } from 'react'
import axios from 'axios'

function User() {

    const [user, setUser] = useState(null)

    axios({
        method: 'get',
        url: 'http://127.0.0.1:8000/users/',
    }).then(response => {
        setUser(response.data);
        console.log(user)
    })
    return (
        <div>
            <h1>The user page</h1>
        </div>
    )
}

export default User
